import '../styles/adminNavbar'
const AdminNavbar = () => {
    return (
        <div className="adminNavbar">

            <div className="title">
                <h1>AdminPortal</h1>
            </div>

            <div className="links">
                <a href="">Add Books</a>
                <a href="">Add Users</a>
                <a href="">Book List</a>
                <a href="">Users List</a>
                <a href="">Logout</a>
            </div>

        </div>
    );
}

export default AdminNavbar;
